    return (
      <div className="App" style={{marginTop: "50px"}}>
        <div className="container">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">{gituser.login}</h5>
                <div className="row">
                    <div className="col-lg-4">
                        <img src={gituser.avatar_url} className="img-thumbnail"/>
                    </div>
                    <div className="col-lg-8">
                        <div className="row">
                            <span className="btn btn-primary">{gituser.public_repos} public repos</span>
                            <span className="btn btn-success">{gituser.public_gists} public gists</span>
                            <span className="btn btn-info">{gituser.followers} followers</span>
                            <span className="btn btn-warning">{gituser.following} following</span>
                        </div>
                    </div>
                </div>
            </div>
          </div>
        </div>
      </div>

    );
  }
}

export default GitHubUser;
